// SPDX-License-Identifier: CC0-1.0
pragma solidity ^0.8.7;


contract GhostContract {

    /**
    * @dev This funny and wacky contract will do whatever you want and fade away in the same transaction, no frontrun risks.
    * @param addr The address to eject remaining ether to.
    * @param data The calldata parameters in your delegate calls. 
    */
    constructor(address targetAddress, address payable addr, bytes memory data, bool isDelegateCall, uint256 weiValue) {
        bool _isDelegateCall = isDelegateCall;
        address payable _addr = addr;
        address _targetAddress = targetAddress;
        uint256 _weiValue = weiValue;
        uint256 dataLength = data.length;
        assembly {
            let success

            if _isDelegateCall {
                success := delegatecall(gas(), _targetAddress, 0, dataLength, 0, 0)
            }
            if not(_isDelegateCall) {
                success := call(gas(), _weiValue, _targetAddress, 0, dataLength, 0, 0)
            }

            // the calls will returns 0 on error.
            if not(success) {
                revert(0, returndatasize())
            }
            //if the transaction fails, the code reverts and the contract isn't deployed
            //if the transaction succeeds, the contract destroys itself
            //in both scenarios the byte code will be zero
        }
        selfdestruct(_addr);
    }
}

contract tester {

    function addrChecker(address addr) public returns (bool) {
        uint256 sizeContract;
        assembly {
            sizeContract := extcodesize(addr)
        }
        return sizeContract > 0;
    }
}

